import React from 'react'
import './Modal.css'

const Modal = ({open}) => {
    if(!open) return null
    return (
    <div className='overlay'>
        <div className="modalContainer">
            <h1>Modal</h1>
        </div>
    </div>
  )
}

export default Modal
